    //获取随机的生日
    function getBirthday(format) {
        format = format || "yyyyMMdd";
        var time = Mtils.security.randomBetween(1, 1520);
        time = new Date(time * 1000000000).format(format);
        return time;
    };


    // 生成随机身份证号
    function getIdcard(sex){
       var coefficientArray = [ "7","9","10","5","8","4","2","1","6","3","7","9","10","5","8","4","2"];// 加权因子
       var lastNumberArray = [ "1","0","X","9","8","7","6","5","4","3","2"];// 校验码
       var address = getAddr().id; // 住址
       var birthday = getBirthday();


       var s = Math.floor(Math.random()*10).toString() + Math.floor(Math.random()*10).toString();
       var flag = true;
       var sex_i = Math.floor(Math.random()*10);
        while(flag && !Mtils.isEmpty(sex)) {
            sex_i = Math.floor(Math.random()*10);
            if(sex_i % 2 === 0 && sex === 0) {
                flag = false;
            } else if(sex_i % 2 !== 0 && sex === 1) {
                flag = false;
            }
        }
        s += sex_i.toString();
   

       var array = (address + birthday + s).split("");   
       var total = 0;
       for(var i=0; i<array.length; i++){
            total = total + parseInt(array[i])*parseInt(coefficientArray[i]);
       }       
       var lastNumber = lastNumberArray[parseInt(total%11)];
       var id_no_String = address + birthday + s + lastNumber;
       
       return id_no_String;
    }


    //sex: 0女 1男
    function getUserInfo(sex) {
        var user =  {};
        var i = Mtils.security.randomBetween(1, 10) % 2;
        if(!Mtils.isEmpty(sex)) i = sex;
        user.name = getName(i);
        user.phone = getMoble();
        user.idcard = getIdcard(i);
        user.email = getEmail(user.name);
        user.addr = getAddr().name;

        user.username = Mtils.utils.makePy(user.name).toLocaleLowerCase();
        user.password = Mtils.security.hex_md5(user.username);
        user.sex = i;

        return user;

    };


